// HomePage.jsx

import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <>
      <h1>Home Page</h1>
      <br />
      <ul>
        <li>
          {/* Endpoint to route to Patients page */}
          <Link to="/Patients">Click to go to the Patients page</Link>
        </li>
        <li>
          {/* Endpoint to route to Doctors page */}
          <Link to="/Doctors">Click to go to the Doctors Page</Link>
        </li>
      </ul>
    </>
  );
};

export default HomePage;
